import React from "react";

export default function ProductTile({ imageSource = "" }) {
  return (
    <div className="m-2">
      <div style={{ minWidth: "25vw", height: "30vw", backgroundColor: "#cdd0d34a" }}>
        <img
          style={{ objectFit: "contain" }}
          width="100%"
          height="100%"
          alt="somePhoto"
          src={imageSource}
        />
      </div>
      <div style={{width: "25vw", overflow: "hidden", textOverflow: "ellipsis", whiteSpace: "nowrap"}}>
        <p style={{fontSize: "10px"}}>Floral Print Contrast Midi dress</p>
        <h6>₹ 504</h6>
          <small style={{display: "flex", alignItems: "center"}}>
            ₹<s> 1007</s>
            <small style={{color: "red", marginInlineStart: "5px"}}> 50% OFF</small>
          </small>
      </div>
    </div>
  );
}
